#include <stdlib.h>
#include <stdbool.h>

/**
 * Note: The returned array must be malloced, assume caller calls free().
 */
int* findIntersectionValues(int* nums1, int nums1Size, int* nums2, int nums2Size, int* returnSize) {
    // Create two boolean arrays to represent sets
    bool set1[101] = {false};
    bool set2[101] = {false};

    // Populate the sets with elements from nums1 and nums2
    for (int i = 0; i < nums1Size; i++) {
        set1[nums1[i]] = true;
    }
    for (int i = 0; i < nums2Size; i++) {
        set2[nums2[i]] = true;
    }

    // Count elements in nums1 that are present in set2, and vice versa
    int count1 = 0, count2 = 0;
    for (int i = 0; i < nums1Size; i++) {
        if (set2[nums1[i]]) {
            count1++;
        }
    }
    for (int i = 0; i < nums2Size; i++) {
        if (set1[nums2[i]]) {
            count2++;
        }
    }

    // Allocate memory for the return array and populate it
    int* result = malloc(2 * sizeof(int));
    result[0] = count1;
    result[1] = count2;
    *returnSize = 2;

    return result;
}
